// components/Cover.js

import React from 'react';
import './Cover.css';

function Cover() {
    return (
        <div className="cover-container">
            <div id="home" className="cover">
                <div className="cover">
                    <div className="padder">
                        <h1>HelloWorld!</h1>
                        <h2>My name is Shahaf, nice to meet you!</h2>
                        <h4>
                            ◦ Data Scientist, Machine Learning Engineer, AI Enthusiast
                            <br />
                            ◦ Boston University Alumni (MS in AI '24, BA in CS '22)
                            <br />
                            ◦ Las Positas College Alumni (AS in CS, AS in Physics, AA in Mathematics '20)
                        </h4>
                        <div className="spacer"></div>
                        <a className="emailme" href='attachments/pdfs/resume.pdf'>My Resume &nbsp; <i className="fa fa-file-text"></i></a>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Cover;
